import React, { useState, useEffect } from 'react';
import axios from 'axios';

function GiayTo() {
  const [activeTab, setActiveTab] = useState('khaisinh');
  const [list, setList] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const endpoint = activeTab === 'khaisinh' ? 'khaisinh' : 'chungtu';
      try {
        const response = await axios.get(`http://localhost:5000/api/giayto/${endpoint}`);
        setList(response.data);
      } catch (error) {
        console.error(`Lỗi khi tải danh sách ${activeTab}:`, error);
      }
    };
    fetchData();
  }, [activeTab]);

  return (
    <div>
      <h2 className="content-header">Quản lý Giấy tờ</h2>
      <div className="tab-container">
        <button className={`tab-button ${activeTab === 'khaisinh' ? 'active' : ''}`} onClick={() => setActiveTab('khaisinh')}>
          Giấy Khai sinh
        </button>
        <button className={`tab-button ${activeTab === 'chungtu' ? 'active' : ''}`} onClick={() => setActiveTab('chungtu')}>
          Giấy Chứng tử
        </button>
      </div>

      {activeTab === 'khaisinh' && (
        <table className="data-table">
          <thead>
            <tr>
              <th>Số Giấy</th>
              <th>Số CCCD</th>
              <th>Ngày Sinh</th>
              <th>Nơi Sinh</th>
              <th>Thông tin Cha Mẹ</th>
            </tr>
          </thead>
          <tbody>
            {list.map((item) => (
              <tr key={item.so_giay}>
                <td>{item.so_giay}</td>
                <td>{item.so_cccd}</td>
                <td>{new Date(item.ngay_sinh).toLocaleDateString()}</td>
                <td>{item.noi_sinh}</td>
                <td>{item.cha_me}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}

      {activeTab === 'chungtu' && (
        <table className="data-table">
          <thead>
            <tr>
              <th>Số Giấy</th>
              <th>Số CCCD</th>
              <th>Ngày Mất</th>
              <th>Nơi Mất</th>
              <th>Nguyên Nhân</th>
            </tr>
          </thead>
          <tbody>
            {list.map((item) => (
              <tr key={item.so_giay}>
                <td>{item.so_giay}</td>
                <td>{item.so_cccd}</td>
                <td>{new Date(item.ngay_mat).toLocaleDateString()}</td>
                <td>{item.noi_mat}</td>
                <td>{item.nguyen_nhan}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default GiayTo;
